import React, { useState, useEffect } from 'react'


const Hourly = ({ hour }) => {
  const [time, setTime] = useState(new Date(hour.time * 1000));
  const [compHour, setCompHour] = useState("");

  useEffect(() => {
    getHour();
  })

  const getHour = () => {
    const compHour = time.getHours();

    setCompHour(compHour);

  }
  return (
    <div>
      <h6>{hour}</h6>
    </div>
  )
}

export default Hourly
